script: |
  super -f text -I q1225.spq | sort > q1225.out

inputs:
  - name: q1225.spq
    data: |
      SELECT DISTINCT - col1 AS col0 FROM tab0 (FORMAT parquet) WHERE - CAST ( NULL AS INTEGER ) >= + + col1 + + col2 * + col0 * - 56 / + + col2;
  - name: tab0

outputs:
  - name: q1225.out
    data: |
